import React from "react";

const VideoList = (props) => {
    if (props.Response){
        const items = props.Response.data.items 

        const VideoItems = () => {
            console.log(items)
            items.map((item => {
                return <img src= {item.snippet.thumbnails.default.url} />
            }))
            return(
                <h1>Hi</h1>
            )
        }

        return(
            <div>
                <VideoItems />
            </div>
            )
}
}


export default VideoList;
